// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "hardhat/console.sol";

interface IV4PositionManager {
    function modifyLiquidities(
        bytes calldata actions,
        bytes[] calldata inputs,
        uint256 deadline
    ) external payable;
}

interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function allowance(address owner, address spender) external view returns (uint256);
}

contract Liquidity {
    IV4PositionManager public positionManager;

    constructor(address _positionManager) {
        positionManager = IV4PositionManager(_positionManager);
    }

    /// @notice Thêm thanh khoản cho một pool Uniswap V4
    function addLiquidity(
        address token0,
        address token1,
        int24  tickLower,
        int24  tickUpper,
        uint24 tierId,
        uint128 amount0Desired,
        uint128 amount1Desired
    ) external payable {
        console.log("Start addLiquidity");

        IERC20 t0 = IERC20(token0);
        IERC20 t1 = IERC20(token1);

        console.log("Token0:", token0);
        console.log("Token1:", token1);

        console.log("Balance token0:", t0.balanceOf(msg.sender));
        console.log("Balance token1:", t1.balanceOf(msg.sender));

        console.log("Amount0:", amount0Desired);
        console.log("Amount1:", amount1Desired);

        console.log("Allowance token0:", t0.allowance(msg.sender, address(this)));
        console.log("Allowance token1:", t1.allowance(msg.sender, address(this)));

        require(t0.allowance(msg.sender, address(this)) >= amount0Desired, "Token0 not approved");
        require(t1.allowance(msg.sender, address(this)) >= amount1Desired, "Token1 not approved");

        // Action codes
        bytes1 MINT_POSITION  = 0x01;
        bytes1 SETTLE_PAIR    = 0x07;

        bytes memory actions = abi.encodePacked(MINT_POSITION, SETTLE_PAIR);

        bytes memory mintInput = abi.encode(
            token0,
            token1,
            tickLower,
            tickUpper,
            tierId,
            amount0Desired,
            amount1Desired,
            msg.sender,       // recipient
            ""                // hookData
        );

        bytes memory settleInput = abi.encode(token0, token1);

bytes[] memory inputs = new bytes[](2);
inputs[0] = mintInput;
inputs[1] = settleInput;

        uint256 deadline = block.timestamp + 600;

        try positionManager.modifyLiquidities{ value: msg.value }(
            actions,
            inputs,
            deadline
        ) {
            console.log("ModifyLiquidities succeeded");
        } catch Error(string memory reason) {
            console.log("Reverted with reason:", reason);
            revert(reason);
        } catch {
            console.log("Reverted without reason");
            revert("modifyLiquidities failed");
        }
    }
}

